describe("HtmlcoinContractFactory", function () {
    it("HtmlcoinContractFactory should deploy correctly given the deployer has enough HTMLCOIN to cover gas", async function () {
        const simpleStore = new HtmlcoinContractFactory(ABI, BYTECODE, signer);
        const deployment = await simpleStore.deploy({
            gasLimit: "0x2dc6c0", gasPrice: "0x9502F9000"
        });
        expect(deployment.address).to.equal(`0x${generateContractAddress(deployment.deployTransaction.hash.split("0x")[1])}`);
        await deployment.deployed();
        const getVal = await deployment.get({
            gasLimit: "0x2dc6c0", gasPrice: "0x9502F9000"
        });
        expect(BigNumber.from(getVal).toNumber()).to.equal(BigNumber.from("0x00").toNumber());
        const setVal = await deployment.set(1001, {
            gasLimit: "0x2dc6c0", gasPrice: "0x9502F9000"
        });
        await setVal.wait();
        expect(BigNumber.from(getVal).toNumber()).to.equal(BigNumber.from("0x00").toNumber());
    });
    it("HtmlcoinContractFactory can be connected to a HtmlcoinWallet signer.", async function () {
        const simpleStore = new HtmlcoinContractFactory(ABI, BYTECODE);
        const connectedSimpleStore = simpleStore.connect(signer);
        if (!!connectedSimpleStore.signer) {
            const deployment = await connectedSimpleStore.deploy({
                gasLimit: "0x2dc6c0",
                gasPrice: "0x9502F9000",
            });
            expect(!!deployment.address, "true");
            await deployment.deployed();
            const getVal = await deployment.get({
                gasLimit: "0x2dc6c0", gasPrice: "0x9502F9000"
            });
            expect(BigNumber.from(getVal).toNumber()).to.equal(BigNumber.from("0x00").toNumber());
        }
    });
    it("HtmlcoinContractFactory should reject if the deployer tries sending a value", async function () {
        const simpleStore = new HtmlcoinContractFactory(ABI, BYTECODE, signer);
        try {
            await simpleStore.deploy({
                gasLimit: "0x2dc6c0", gasPrice: "0x9502F9000", value: "0xffffff"
            });
        }
        catch (err) {
            expect(err.reason).to.equal("You cannot send HTMLCOIN while deploying a contract. Try deploying again without a value.");
        }
    });
    it("HtmlcoinContractFactory should fail as the deployer has no UTXOs to spend", async function () {
        const simpleStore = new HtmlcoinContractFactory(ABI, BYTECODE, signerNoHtmlcoin);
        console.log(signerNoHtmlcoin.address);
        try {
            await simpleStore.deploy({
                gasLimit: "0x2dc6c0", gasPrice: "0x9502F9000"
            });
        }
        catch (err) {
            expect(err.reason).to.equal("Needed amount of UTXO's exceed the total you own.");
        }
    });
});
